import "./App.css";
import stypes from "s-types";
function Student(s) {
  return (
    <div className="student">
      <p>Name: {s.name}</p>
      <p>Age: {s.age}</p>
      <p>Student: {s.isStudent ? "Yes" : "No"}</p>
    </div>
  );
}

Student.prototype = {};
export default Student;
